CREATE VIEW qryRequisicionesASurtir AS select docf_Documento.sys_pk AS PKDocumento, linea.Descripcion as ldescripcion,docf_Documento.sys_dtcreated, docf_Documento.IAlmacen, docf_Documento.IAlmacen_Destino, Producto.Codigo, Producto.Descripcion as pdescripcion, docf_DDocumento.Unidad,  Sum(docf_DDocumento.Cantidad) AS Cantidad, BlockDocumentos.Serie, FoliosDocumentos.Folio,if(isnull(Existencias.Existencia),0,Existencias.Existencia) AS Existencia, docf_Status.Descripcion AS Status from ((((docf_Documento inner join (docf_DDocumento inner join Producto on docf_DDocumento.IProducto=Producto.Sys_PK) on docf_Documento.sys_pk=docf_DDocumento.IDocumento) inner join Linea on Producto.ILinea=Linea.Sys_PK)INNER JOIN (FoliosDocumentos INNER JOIN BlockDocumentos on FoliosDocumentos.Block=BlockDocumentos.sys_pk) on docf_documento.IFolio=FoliosDocumentos.sys_pk) Left Join Existencias ON  docf_Documento.IAlmacen_Destino=Existencias.IAlmacen and docf_DDocumento.IProducto=Existencias.FK_Producto_IExistencias) LEFT JOIN docf_Status on docf_Documento.IStatus = docf_Status.Sys_PK Group by docf_Documento.sys_pk,linea.Descripcion ,docf_Documento.sys_dtcreated, docf_Documento.IAlmacen, docf_Documento.IAlmacen_Destino, Producto.Codigo, Producto.Descripcion , docf_DDocumento.Unidad,  BlockDocumentos.Serie, FoliosDocumentos.Folio,if(isnull(Existencias.Existencia),0,Existencias.Existencia), docf_Status.Descripcion ORDER BY linea.Descripcion, Producto.Descripcion;
create view qryNvaRequisicionDeIngredientesAPartirDeRecetas as SELECT  P2.Sys_PK, P2.IClase, docf_Documento.sys_pk AS IDocumento, docf_DDocumento.Cantidad * docf_DDocumento.Factor * IEnsamble.Cantidad AS cantidad, P2.Unidad, P2.FactorB, P2.CostoUltimo, P2.Precio1, P2.Existencia AS existenciaGlobal, docf_Documento.IAlmacen_Destino AS almacen from (docf_DDocumento inner join (docf_documento left join existencias on docf_documento.ialmacen_destino=existencias.ialmacen) on docf_ddocumento.idocumento=docf_documento.sys_pk) inner join (producto inner join (iensamble inner join producto p2 on iensamble.elemento=p2.sys_pk) on producto.sys_pk=iensamble.fk_producto_elementos) on docf_ddocumento.iproducto=producto.sys_pk WHERE Producto.IClase = 2 or producto.iclase = 5 GROUP BY P2.Sys_PK, P2.IClase, docf_Documento.sys_pk, docf_DDocumento.Cantidad, docf_DDocumento.Factor, IEnsamble.Cantidad, P2.Unidad, P2.FactorB, P2.CostoUltimo, P2.Precio1, P2.Existencia, docf_Documento.IAlmacen_Destino;
create view qRequisiciones as SELECT docf_Documento.Sys_PK, DATE_FORMAT(docf_Documento.sys_dtcreated, '%d/%m/%Y') as Fecha, docf_tipo.Descripcion as Tipo_Requisicion, docf_Status.ID as IDStatus, docf_Status.Descripcion as Status, BlockDocumentos.Serie, FoliosDocumentos.Folio, TUser.UserName as Remitente, t2.UserName as Destinatario, docf_Documento.Asunto, Almacen.Descripcion as almaceno, a2.Descripcion as almacend, YEAR(docf_documento.sys_dtcreated) as Anio, month(docf_documento.sys_dtcreated) as mes, docf_Tipo.ID as IDTipo, ifnull(docf_documento.sys_deleted,0) as Eliminado, TUser.Sys_PK as PKRemitente, t2.Sys_PK as PKDestinatario, (docf_ddocumento.factor * docf_ddocumento.cantidad) as CantidadReal, docf_ddocumento.ejercido as Ejercido, docf_Documento.uf_Color FROM (((((((docf_Documento INNER JOIN docf_Status on docf_Documento.IStatus = docf_Status.sys_pk) INNER JOIN FoliosDocumentos on docf_Documento.IFolio = FoliosDocumentos.Sys_PK) INNER JOIN BlockDocumentos on FoliosDocumentos.Block = BlockDocumentos.Sys_PK) LEFT JOIN TUser on docf_documento.IUsuario = TUser.Sys_PK) LEFT JOIN TUser t2 on docf_Documento.IDestinatario = t2.Sys_PK) LEFT JOIN Almacen on (docf_Documento.IAlmacen = Almacen.Sys_PK) LEFT JOIN Almacen a2 on docf_Documento.IAlmacen_Destino = a2.Sys_PK) LEFT JOIN docf_Tipo on docf_Documento.ITipo = docf_Tipo.sys_pk) LEFT JOIN docf_DDocumento on docf_Documento.sys_pk = docf_DDocumento.IDocumento ORDER BY SYS_PK;
alter table producto add column uf_GrupoSimilares int null;
create view qryrepSaldoClientesX as select cliente.Sys_PK AS PKCliente,cliente.Codigo AS CCodigo,cliente.Nombre AS CNombre,dcxc.Referencia AS Referencia,dcxc.Aplicacion AS vencimiento,(to_days(now()) - to_days(dcxc.Aplicacion)) AS dias,ifnull(agente.Sys_PK,0) AS PKAgente,ifnull(agente.Codigo,'0000') AS ACodigo,ifnull(agente.Nombre,'Sin vendedor') AS ANombre,(((year(dcxc.Aplicacion) * 10000) + (month(dcxc.Aplicacion) * 100)) + dayofmonth(dcxc.Aplicacion)) AS NDFecha,dcxc.Debe AS importe,(((dcxc.Debe + dcxc.IntMoratorios) - dcxc.Bonificaciones) - dcxc.Pagos) AS Saldo from (((dcxc join cliente on((dcxc.ICliente = cliente.Sys_PK))) left join venta on((dcxc.IVenta = venta.Sys_PK))) left join agente on((venta.IAgente = agente.Sys_PK))) where ((dcxc.Aplicable <> 0) and ((((dcxc.Debe + dcxc.IntMoratorios) - dcxc.Bonificaciones) - dcxc.Pagos) <> 0)) group by cliente.Sys_PK,cliente.Codigo,cliente.Nombre,dcxc.Referencia,dcxc.Aplicacion,dcxc.Debe;
create view qryAtenciones as SELECT ut_crmnotacaso.*, ut_crmcasos.fk_tipocaso, day(ut_crmnotacaso.Sys_DTCreated) as Dia, week(ut_crmnotacaso.Sys_DTCreated,1) AS semana, Month(ut_crmnotacaso.Sys_DTCreated) as Mes, YEAR(ut_crmnotacaso.Sys_DTCreated) as Anio, ((year(ut_crmnotacaso.Sys_DTCreated) * 10000) + (month(ut_crmnotacaso.Sys_DTCreated) * 100) + (day(ut_crmnotacaso.Sys_DTCreated))) as NDCreacion, Cliente.Sys_PK as PKCliente, Cliente.Codigo as CCliente, Cliente.Nombre as Cliente FROM ut_crmnotacaso inner join ut_crmcasos on ut_crmnotacaso.fk_caso = ut_crmcasos.sys_pk inner join cliente on ut_crmcasos.fk_cliente = cliente.sys_pk;
CREATE VIEW qryadmoncasos AS select distinct Cliente.Sys_PK as PKCliente, cliente.Codigo AS CCliente,cliente.Nombre AS Cliente,ut_crmcasos.asunto AS asunto,ut_crmtipocaso.Sys_PK AS PKTipoCaso,ut_crmtipocaso.uf_descripcion AS TipoCaso,ut_crmprioridad.descripcion AS Prioridad,ut_crmcasos.Sys_PK AS PKCaso,ut_crmcasos.usuarioabre AS usuarioabre,ut_crmcasos.usuarioasignado AS usuarioasignado,ut_crmcasos.usuariocierra AS usuariocierra,ut_crmcasos.fechavencimiento AS vencimiento,timediff(ut_crmcasos.fechavencimiento,now()) AS mDiferencia,ut_crmcasos.fechaapertura AS fechaapertura,ut_crmcasos.horaapertura AS horaapertura,ut_crmcasos.fechacierre AS fechacierre,ut_crmcasos.horacierre AS horacierre,date_format(concat(cast(ut_crmcasos.fechacierre as date),' ',cast(ut_crmcasos.horacierre as time)),'%Y-%m-%d %H:%i:%s') AS cierre,ifnull(ut_crmcasos.status,0) AS status,ut_crmcasos.Sys_DTCreated AS creado,ut_crmcasos.Sys_TimeStamp AS ActualizacionCaso,ifnull((select max(ut_crmnotacaso.Sys_TimeStamp) AS Actualizacion from ut_crmnotacaso where (ut_crmnotacaso.fk_caso = ut_crmcasos.Sys_PK)),ut_crmcasos.Sys_TimeStamp) AS UltimaActualizacion,ut_crmcasos.uf_color AS uf_color from (((ut_crmcasos join cliente on((ut_crmcasos.fk_cliente = cliente.Sys_PK))) join ut_crmtipocaso on((ut_crmcasos.fk_tipocaso = ut_crmtipocaso.Sys_PK))) left join ut_crmprioridad on((ut_crmcasos.fk_prioridad = ut_crmprioridad.Sys_PK))) order by ut_crmcasos.Sys_PK desc;
CREATE VIEW qryadmoncasos_2 AS select z.PKCaso AS PKCaso,z.Prioridad AS Prioridad,z.TipoCaso AS TipoCaso,z.PKTipoCaso AS PKTipoCaso,z.asunto AS asunto,z.usuarioabre AS usuarioabre, ifnull(z.usuarioasignado,'') AS usuarioasignado,z.usuariocierra AS usuariocierra,z.status AS status,z.vencimiento AS vencimiento, z.PKCliente, z.CCliente AS ccliente,z.Cliente AS cliente, DATE_FORMAT(if((z.ActualizacionCaso >= z.UltimaActualizacion),z.ActualizacionCaso,z.UltimaActualizacion), '%Y-%m-%d %H:%i:%s') AS Actualizacion,z.uf_color AS uf_color, cast(if(z.status = 1, timediff(z.vencimiento, if(z.status = 0, now(), z.cierre)), z.mDiferencia) as char) AS mDiferencia, (((year(z.creado) * 10000) + (month(z.creado) * 100)) + dayofmonth(z.creado)) AS NDCreacion,week(z.vencimiento,1) AS semana, week(z.fechaapertura,1) AS semanaapertura, week(z.fechacierre,1) AS semanacierre, z.fechaapertura, z.horaapertura, z.fechacierre, z.horacierre, (((year(z.fechacierre) * 10000) + (month(z.fechacierre) * 100)) + dayofmonth(z.fechacierre)) AS NDCierre from qryadmoncasos z;
create view qryEstatisticaTiposCaso as select -1 as Sys_Pk, 'Global' as uf_descripcion union all select -2 as Sys_Pk, 'Clientes' as uf_descripcion union all select Sys_PK, uf_descripcion from ut_crmtipocaso where status <> 99;
create view qryAtenciones_Atn as SELECT ut_crmnotacliente.*, day(ut_crmnotacliente.Sys_DTCreated) as Dia, week(ut_crmnotacliente.Sys_DTCreated,1) AS semana, Month(ut_crmnotacliente.Sys_DTCreated) as Mes, YEAR(ut_crmnotacliente.Sys_DTCreated) as Anio, ((year(ut_crmnotacliente.Sys_DTCreated) * 10000) + (month(ut_crmnotacliente.Sys_DTCreated) * 100) + (day(ut_crmnotacliente.Sys_DTCreated))) as NDCreacion, Cliente.Sys_PK as PKCliente, Cliente.Codigo as CCliente, Cliente.Nombre as Cliente FROM ut_crmnotacliente inner join cliente on ut_crmnotacliente.fk_cliente = cliente.sys_pk;
