CREATE TABLE ut_CRM_Acuerdos (Sys_PK INT(11) NOT NULL AUTO_INCREMENT PRIMARY KEY, Sys_TimeStamp DATETIME, Sys_GUID VARCHAR(32) NOT NULL UNIQUE, Sys_DTCreated DATETIME, Sys_User VARCHAR(5), Sys_LastUser VARCHAR(5), Sys_Exported TINYINT(1) DEFAULT 0, Sys_DTExported DATETIME, Sys_Info VARCHAR(32), Referencia VARCHAR(10) NOT NULL UNIQUE, NumAcuerdo INT(11) DEFAULT 0, Fecha DATE, FPagoAcordada DATE, FechaCumplimiento DATE, IVenta INT(11) NOT NULL, IPagare INT(11), IUsuario INT(11) NOT NULL, ImporteAcordado DECIMAL(19,8) NOT NULL DEFAULT 0,	Cumplido BIT DEFAULT 0, ResponsableAcuerdo VARCHAR(255), IRecibo INT(11), Notas MEDIUMTEXT);
CREATE TABLE ut_CRM_Acuerdos_Recibos_ (Sys_PK	int(11) NOT NULL AUTO_INCREMENT PRIMARY KEY, Sys_TimeStamp DATETIME, Sys_GUID VARCHAR(32) NOT NULL UNIQUE, Sys_DTCreated DATETIME, Sys_User VARCHAR(5), Sys_LastUser VARCHAR(5), Sys_Exported TINYINT(1) DEFAULT 0, Sys_DTExported DATETIME, Sys_Info VARCHAR(32), Fecha DATE, IAcuerdo INT(11), IRecibo INT(11), IUsuario INT(11));

CREATE OR REPLACE VIEW QryCRMSaldoClientes AS SELECT dcxc.Sys_PK AS PKDCxC, cliente.Sys_PK AS PKCliente, cliente.Codigo AS CCodigo, cliente.Nombre AS CNombre, dcxc.Referencia AS Referencia, dcxc.Aplicacion AS vencimiento, (TO_DAYS(NOW()) - TO_DAYS(dcxc.Aplicacion)) AS dias, IFNULL(agente.Sys_PK, 0) AS PKAgente, IFNULL(agente.Codigo, _latin1 '0000') AS ACodigo, IFNULL(agente.Nombre, _latin1 'Sin vendedor') AS ANombre, (((YEAR(dcxc.Aplicacion) * 10000) + (MONTH(dcxc.Aplicacion) * 100)) + DAYOFMONTH(dcxc.Aplicacion)) AS NDFecha, dcxc.Debe AS importe, (((dcxc.Debe + dcxc.IntMoratorios) - dcxc.Bonificaciones) - dcxc.Pagos) AS Saldo, dcxc.AcuerdoDePago AS AcuerdoPago, ut_crm_acuerdos.FPagoAcordada AS VencimientoAcuerdo, (((YEAR(ut_crm_acuerdos.FPagoAcordada) * 10000) + (MONTH(ut_crm_acuerdos.FPagoAcordada) * 100)) + DAYOFMONTH(ut_crm_acuerdos.FPagoAcordada)) AS NDFechaAcuerdo FROM ((((dcxc LEFT JOIN ut_CRM_Acuerdos ON dcxc.AcuerdoDePago = ut_CRM_Acuerdos.Sys_PK) JOIN cliente ON ((dcxc.ICliente = cliente.Sys_PK))) LEFT JOIN venta ON ((dcxc.IVenta = venta.Sys_PK))) LEFT JOIN agente ON ((venta.IAgente = agente.Sys_PK))) WHERE ((dcxc.Aplicable <> 0) AND ((((dcxc.Debe + dcxc.IntMoratorios) - dcxc.Bonificaciones) - dcxc.Pagos) <> 0)) GROUP BY cliente.Sys_PK, cliente.Codigo, cliente.Nombre, dcxc.Referencia, dcxc.Aplicacion, dcxc.Debe;

CREATE OR REPLACE VIEW QryCatClientes AS SELECT DISTINCT cliente.Sys_PK AS Sys_PK, tipocliente.Sys_PK AS PKTipoCliente, cliente.Codigo AS Codigo, cliente.Nombre AS Nombre, cliente.RFC AS RFC, domicilio.Direccion AS Direccion, domicilio.Colonia AS Colonia, domicilio.CodPos AS Codigo_Postal, domicilio.Telefonos AS Telefono, cliente.eMail AS eMail, cliente.Saldo AS Saldo, (SELECT COUNT(ut_CRM_Acuerdos.Sys_PK) AS NumAcuerdos FROM (ut_CRM_Acuerdos INNER JOIN Venta ON ut_CRM_Acuerdos.IVenta = Venta.Sys_PK) WHERE Venta.ICliente = Cliente.Sys_PK AND ut_CRM_Acuerdos.Cumplido = 0) AS AcuerdosPendientes FROM ((cliente LEFT JOIN tipocliente ON ((cliente.Tipo = tipocliente.Sys_PK))) LEFT JOIN domicilio ON ((domicilio.Sys_PK = cliente.Domicilio1))) WHERE IFNULL(cliente.Uf_Sys_Baja, 0) = 0 ORDER BY cliente.Nombre;

