CREATE OR REPLACE VIEW qactiproy AS SELECT 'Proyecto' AS Tipo, proyecto.Sys_PK AS Sys_PK, actividad.FInicio AS Cita, CONCAT(persona.Nombre,  ' ', IF(ISNULL(persona.Apellido1),  ' ', persona.Apellido1),  ' ', IF(ISNULL(persona.Apellido2),  ' ', persona.Apellido2)) AS contacto, organizacion.Nombre AS empresa, CONCAT(mdtpactividad.Nombre,  ' ', actividad.Asunto) AS asunto, organizacion.Tel1 AS telefono, persona.EMail AS email, proyecto.IEjecutivo AS ejecutivo FROM (((((mdtpactividad JOIN actividad ON ((mdtpactividad.Sys_PK = actividad.ITpActividad))) JOIN proyecto ON ((actividad.IProyecto = proyecto.Sys_PK))) JOIN meta ON ((proyecto.IMeta = meta.Sys_PK))) JOIN organizacion ON ((organizacion.Sys_PK = proyecto.IOrganizacion))) JOIN persona ON ((proyecto.IContacto = persona.Sys_PK))) WHERE ((actividad.Hecho = 0) AND (proyecto.UF_Status1 <> 5) AND (proyecto.UF_Status1 <> 6) AND (CAST(actividad.FInicio AS date) <= CAST(NOW() AS date))) ORDER BY actividad.FInicio;
CREATE OR REPLACE VIEW qacticon AS SELECT 'Contacto' AS Tipo, ut_icontact.Sys_PK AS Sys_PK, ut_icontact.uf_proxcontac AS cita, ut_icontact.uf_Nombre AS contacto, ut_icontact.uf_Empresa AS empresa, 'Llamar para generar oportunidad' AS asunto, ut_icontact.uf_Telefono AS telefono, ut_icontact.uf_EMail AS email, ut_icontact.uf_IEjecutivo AS ejecutivo FROM ut_icontact WHERE ((ut_icontact.uf_Status = 0) AND ((CAST(ut_icontact.uf_proxcontac AS date) <= CAST(NOW() AS date)) OR ISNULL(ut_icontact.uf_proxcontac))) ORDER BY ut_icontact.uf_proxcontac;
CREATE OR REPLACE VIEW qhoyx AS SELECT qactiproy.Tipo AS Tipo, qactiproy.Sys_PK AS Sys_PK, qactiproy.Cita AS Cita, qactiproy.contacto AS contacto, qactiproy.empresa AS empresa, qactiproy.asunto AS asunto, qactiproy.telefono AS telefono, qactiproy.email AS email, qactiproy.ejecutivo AS ejecutivo FROM qactiproy UNION ALL SELECT qacticon.Tipo AS Tipo, qacticon.Sys_PK AS Sys_PK, qacticon.cita AS cita, qacticon.contacto AS contacto, qacticon.empresa AS empresa, qacticon.asunto AS asunto, qacticon.telefono AS telefono, qacticon.email AS email, qacticon.ejecutivo AS ejecutivo FROM qacticon;
CREATE OR REPLACE VIEW qhoy AS SELECT qhoyx.Tipo AS Tipo, qhoyx.Sys_PK AS Sys_PK, qhoyx.Cita AS Cita, qhoyx.contacto AS contacto, qhoyx.empresa AS empresa, qhoyx.asunto AS asunto, qhoyx.telefono AS telefono, qhoyx.email AS email, qhoyx.ejecutivo AS ejecutivo FROM qhoyx;
CREATE OR REPLACE VIEW qatascados AS SELECT 'Proyecto' AS tipo, proyecto.Sys_PK AS Sys_PK, NULL AS Cita, organizacion.Nombre AS empresa, 'Revizar estado del proyecto' AS contacto, 'sin asunto' AS asunto, 'verificar' AS telefono, 'verificar' AS email, proyecto.IEjecutivo AS ejecutivo FROM ((proyecto JOIN meta ON proyecto.IMeta = meta.Sys_PK) JOIN organizacion ON organizacion.Sys_PK = proyecto.IOrganizacion) WHERE ((proyecto.UF_Status1 <> 5) AND (proyecto.UF_Status1 <> 6));
CREATE OR REPLACE VIEW qpersonasorgs AS SELECT persona.Sys_PK AS Sys_PK, persona.Apellido1 AS Apellido1, persona.Apellido2 AS Apellido2, persona.Nombre AS Nombre, r_p2o.IOrganizacion AS IOrganizacion, CONCAT(IFNULL(persona.Apellido1, ''), ' ', IFNULL(persona.Apellido2, ''), ' ', IFNULL(persona.Nombre, '')) AS NombreCompleto FROM (persona JOIN r_p2o ON persona.Sys_PK = r_p2o.IPersona) GROUP BY persona.Sys_PK, persona.Apellido1, persona.Apellido2, persona.Nombre, r_p2o.IOrganizacion;
