CREATE PROCEDURE AddOrigenContacto (IN Origen varchar(255)) BEGIN DECLARE Counter int; SET Counter = (SELECT COUNT(Sys_PK) AS Counted FROM ut_origencontacto WHERE ut_origencontacto.uf_Origen = Origen); IF Counter <= 0 THEN INSERT INTO ut_OrigenContacto (Sys_TimeStamp, Sys_GUID, Sys_DTCreated, Sys_Exported, Sys_DTExported, sys_recver, sys_deleted, sys_lock, uf_Origen, uf_Descripcion) VALUES (NOW(), REPLACE(UUID(), '-', ''), NOW(), 0, NOW(), 0, 0, 0, Origen, Origen); END IF; END
CREATE PROCEDURE AddInteresContacto (IN Interes varchar(255)) BEGIN DECLARE Counter int; SET Counter = (SELECT COUNT(Sys_PK) AS Counted FROM ut_interescontacto WHERE ut_interescontacto.uf_Interes = Interes); IF Counter <= 0 THEN INSERT INTO ut_interescontacto (Sys_TimeStamp, Sys_GUID, Sys_DTCreated, Sys_Exported, Sys_DTExported, sys_recver, sys_deleted, sys_lock, uf_Interes, uf_Descripcion) VALUES (NOW(), REPLACE(UUID(), '-', ''), NOW(), 0, NOW(), 0, 0, 0, Interes, Interes); END IF; END
CREATE TABLE ut_ReferenciaContacto (Sys_PK INT(11) AUTO_INCREMENT PRIMARY KEY, Sys_TimeStamp DATETIME, Sys_GUID VARCHAR(32) UNIQUE, Sys_DTCreated DATETIME, Sys_User VARCHAR(5), Sys_LastUser VARCHAR(5), Sys_Exported BIT, Sys_DTExported DATETIME, Sys_Info VARCHAR(32), sys_recver INT(11), sys_deleted BIT, sys_lock BIT, uf_Referencia VARCHAR(255) UNIQUE, uf_Descripcion VARCHAR(2048));
CREATE PROCEDURE AddReferenciaContacto (IN Referencia varchar(255)) BEGIN DECLARE Counter int; SET Counter = (SELECT COUNT(Sys_PK) AS Counted FROM ut_referenciacontacto WHERE ut_referenciacontacto.uf_Referencia = Referencia); IF Counter <= 0 THEN INSERT INTO ut_referenciacontacto (Sys_TimeStamp, Sys_GUID, Sys_DTCreated, Sys_Exported, Sys_DTExported, sys_recver, sys_deleted, sys_lock, uf_Referencia, uf_Descripcion) VALUES (NOW(), REPLACE(UUID(), '-', ''), NOW(), 0, NOW(), 0, 0, 0, Referencia, Referencia); END IF; END

